pragma solidity ^0.8.13;

/// @title Utils for math operations with uint16
/// @notice Contains helper functions for some math operations
library UintUtils {
    /// @dev Checks if adding two uint16 values will overflow or not
    function canAdd(uint16 variable, uint16 value) public pure returns (bool) {
        return (variable + value >= variable);
    }

    /// @dev Checks if subtracting two uint16 values will underflow or not
    function canSubtract(uint16 variable, uint16 value) public pure returns (bool) {
        return (value <= variable - value);
    }
}
